import React from 'react';
import {Container} from "react-bootstrap";
import NavBar from "../components/NavBar";
import {fetchProducts} from "../http/productAPI";

const Adm = () => {
    const products = fetchProducts()
    console.log(products)
    return (
        <Container className="d-flex flex-column">
            <NavBar />
            <Container className="d-flex justify-content-between mt-3 pl-3 pr-3">
                <h2 className="align-items-center"> Мои продукты </h2>
            </Container>
            <table>
                <thead>
                <tr>
                    <th>Column 1</th>
                    <th>Column 2</th>
                    <th>Column 3</th>
                    <th>Column 4</th>
                    <th>Column 5</th>
                    <th>Column 6</th>
                    <th>Column 7</th>
                </tr>
                </thead>
                <tbody>
                {products.map(item => (
                    <tr key={item.id}>
                        <td>{item.price}</td>
                        <td>{item.Height}</td>
                        <td>{item.Width}</td>
                        <td>{item.price}</td>
                        <td>{item.Height}</td>
                        <td>{item.Width}</td>
                        <td>{item.price}</td>
                        <td>{item.Height}</td>
                        <td>{item.Width}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </Container>
    );
};

export default Adm;
